import React from 'react';
import './Sidebar.css';

const Sidebar = () => {
  return (
    <div className="sidebar">
      <div className="sidebar__item">
        <h2>Student Details</h2>
      </div>
      <div className="sidebar__item">
        <h2>Create a Test</h2>
      </div>
    </div>
  );
};

export default Sidebar;
